ProductEntryInputData_Class.prototype.loadData = function()
{
	var rawData 									= this.PRODUCT_DETAILS_IC_WITH_SLV_AND_HEADING_NEW;  
	// var rawData 									= this.PRODUCT_BOOKING;
	//var rawData 									= this.PRODUCT_CITY145;
	//var rawData 									= this.PRODUCT_GPS;
	//var rawData 									= this.PRODUCT_MOBMYSITE;
	//var rawData 									= this.PRODUCT_WPINCOLUMN;  
	
	var aData 										        = [];
	aData["general"] 				                        = rawData.general;
	aData["appearances"] 			                        = [];
	aData["appearances"]["appearanceContent"]               = [];
	aData["appearances"]["appearanceContent"]["address"]    = [];
	aData["appearances"]["appearanceContent"]["tlAddress"]  = [];
	aData["attributes"] 			                        = [];
	aData["hiddenAttributes"] 		                        = [];
	
	var aAppearanceData 		        = [];
	var aAppearanceContentData 	        = [];
	var aAppearanceContentAddressData 	= [];
	var aAppearanceContentTlAddressData = [];
	var aHiddenAttributeData 	        = [];
		
  // Load attributes
  // ---------------
	for (i=0; i<rawData.attributes.length;i++)
  {
  	if (rawData.attributes[i].relationType!="HI" && rawData.attributes[i].relationType!="HU")
  	{  		
  		// debug - start //////////////////////////////////////////////////////////
  			//{"definitionType":"R",
      	// "queryName":"SLV_ITEMCODE",
      	// "attributeCode":"BOOKINGTYP",
      	// "attributeName":"Booking type",
      	// "attributeType":"F",
      	// "maxLength":"0",
      	// "fieldType":"NR",
      	// "attributeDescription":"Booking type (Basibooking, Advancedbooking)",
      	// "relationType":"MO",
      	// "finalInd":"N",
      	// "previewInd":"N",
      	// "appearOnBillInd":"",
      	// "showAllValues":"N",
      	// "referenceQueryId":"27",
      	// "querySql":"",
      	// "slvInfo":{"columnValues":[{"codeColumnValue":"ADVBK","decodeColumnValue":"Pro Booking","populatedFieldValue":""},{"codeColumnValue":"BASBK","decodeColumnValue":"Basic Booking","populatedFieldValue":""}],
      	// "codeColumnDisplayedName":"Value","decodeColumnDisplayedName":"Description","populatedFieldAttribute":"","populatedColumnDisplayedName":""},
      	// "defaultValue":"",
      	// "contentType":"",
      	// "values":null}

			console.info("Definition Type: " + rawData.attributes[i].definitionType + 
			            " - Attribute Type: " + rawData.attributes[i].attributeType  + 
			            " - Field Type: " + rawData.attributes[i].fieldType +
			            " - Max Length: " + rawData.attributes[i].maxLength + 			             
			            " - Final Ind: " + rawData.attributes[i].finalInd +
			            " - Preview Ind: " + rawData.attributes[i].previewInd +
			            " - Show All Values: " + rawData.attributes[i].showAllValues +
			            " - Default Value: " + rawData.attributes[i].defaultValue +
			            " - Content Type: " +  rawData.attributes[i].contentType +
			            " - Code: " + rawData.attributes[i].attributeCode  + 
			            " - Name: " + rawData.attributes[i].attributeName 
			            );

  		//if (rawData.attributes[i].definitionType == 'C')
  		//{
  		//	console.info("Name: " + rawData.attributes[i].attributeName + " - Attribute Type: " + rawData.attributes[i].attributeType + " - Field Type: " + rawData.attributes[i].fieldType+ " - Definition Type: " + rawData.attributes[i].definitionType);
      //} 
      // debug - end 	//////////////////////////////////////////////////////
      
      
  		switch (rawData.attributes[i].attributeType)
  		{
  			case "A":
  			  this.handleAttribute(rawData.attributes[i], aAppearanceData,aAppearanceContentAddressData,aAppearanceContentTlAddressData);
  				break;
  			
  			case "R":
  				this.handleAttribute(rawData.attributes[i],aAppearanceContentData,aAppearanceContentAddressData,aAppearanceContentTlAddressData);
  				break;
  			
  			default:
  				this.handleAttribute(rawData.attributes[i], aData["attributes"]);
  		}
  	}
  	else
  	{
  		aHiddenAttributeData.push (rawData.attributes[i]);
  	}
  }
  
	aData["appearances"]["appearance"]			            = aAppearanceData;
	aData["appearances"]["appearanceContent"]	            = aAppearanceContentData;
	aData["appearances"]["appearanceContent"]["address"]    = aAppearanceContentAddressData;
	aData["appearances"]["appearanceContent"]["tlAddress"]  = aAppearanceContentTlAddressData;
	aData["hiddenAttributes"]                               = aHiddenAttributeData;
	
	//console.info ("Mati - aAppearanceData: " +aAppearanceData);
	//console.info ("Mati - aData['appearances'][appearance']: " + aData["appearances"]["appearance"]);
	return aData;
		
}

ProductEntryInputData_Class.prototype.handleAttribute = function(oAttribute, aContainer,aAppearanceContentAddressData,aAppearanceContentTlAddressData)
{
    //////////////////////////////////////////////////////////////////
    // ADDINFO
    // HOUSENO
    // STREET
    // BOXNO
    // POSTCODE
    // LOCALITY
    // CTRYCODE

    // TLADDINFO
    // TLHOUSENO
    // TLSTREET
    // TLBOXNO
    // TLPOSTCODE
    // TLLOCALITY
    // TLCTRYCODE
    //////////////////////////////////////////////////////////////////

	if ((typeof(oAttribute.values) != "undefined") && (oAttribute.values != null))
	{
		if (oAttribute.values.length == 2)
		{
			console.info("LOV 2 values - 1: " + oAttribute.values[0].valueContent + " 2: " + oAttribute.values[1].valueContent);
		}
	}

	switch(oAttribute.attributeCode )
	{
	    case "TLADDINFO":
	    case "TLHOUSENO":
	    case "TLSTREET":
	    case "TLBOXNO":
	    case "TLPOSTCODE":
	    case "TLLOCALITY":
	    case "TLCTRYCODE":
	        aAppearanceContentTlAddressData.push(oAttribute);
	        break;

	    case "ADDINFO":
	    case "HOUSENO":
	    case "STREET":
	    case "BOXNO":
	    case "POSTCODE":
	    case "LOCALITY":
	    case "CTRYCODE":
	        aAppearanceContentAddressData.push(oAttribute);
	        break;

	    default:
	        aContainer.push(oAttribute);
	}

}

